import React from 'react';
import GeneralHeader from '../common/GeneralHeader';

function Home() {
    return (
        <div>
            <GeneralHeader />
            <div>
                <h1>Добро пожаловать на сайт Пушистые Путешествия</h1>
            </div>
        </div>
    );
}

export default Home;
